import React from "react";
import "./HotelHomepage.css";

const hotelpage = [
  {
    name: "Hotels",
    count: 233,
    image: "./images/type_1.webp",
  },
  {
    name: "Apartments",
    count: 2331,
    image: "./images/type_2.jpg",
  },
  {
    name: "Resorts",
    count: 2331,
    image: "./images/type_3.jpg",
  },
  {
    name: "Villas",
    count: 2331,
    image: "./images/type_4.jpg",
  },
  {
    name: "Cabins",
    count: 2331,
    image: "./images/type_5.jpg",
  },
];

function HotelHomestay() {
  return (
    <div>
      <div hotel_0>
        <img className="hotelimg" src={hotelpage[0].image}></img>
        <h2 className="hotelname">{hotelpage[0].name}</h2>
        <p className="hotelcount">{hotelpage[0].count}</p>
      </div>
      <div hotel_1>
        <img className="hotelimg" src={hotelpage[1].image}></img>
        <h2 className="hotelname">{hotelpage[1].name}</h2>
        <p className="hotelcount">{hotelpage[1].count}</p>
      </div>
      <div hotel_2>
        <img className="hotelimg" src={hotelpage[2].image}></img>
        <h2 className="hotelname">{hotelpage[2].name}</h2>
        <p className="hotelcount">{hotelpage[2].count}</p>
      </div>
      <div hotel_3>
        <img className="hotelimg" src={hotelpage[3].image}></img>
        <h2 className="hotelname">{hotelpage[3].name}</h2>
        <p className="hotelcount">{hotelpage[3].count}</p>
      </div>
      <div hotel_4>
        <img className="hotelimg" src={hotelpage[4].image}></img>
        <h2 className="hotelname">{hotelpage[4].name}</h2>
        <p className="hotelcount">{hotelpage[4].count}</p>
      </div>
    </div>
  );
}
export default HotelHomestay;
